from sympy import isprime
def ok(n):
    if not isprime(n): return False
    s, b = str(n), bin(n)[2:]
    return isprime(int(s[-1]+s[:-1])) and isprime(int(b[-1]+b[:-1], 2))
print([k for k in range(11300) if ok(k)]) # _Michael S. Branicky_, Sep 24 2025

